function filterByType() {
    var type = $("input[name='TypeDiv']:checked").val();
    if (type != undefined) {
        if ($('#Package').is(":checked")) {
            $(".package").css('display', 'block');
        }
        else {
            $(".package").css('display', 'none');
        }

        if ($('#Profile').is(":checked")) {
            $(".Profile").css('display', 'block');
        }
        else {
            $(".Profile").css('display', 'none');
        }

        if ($('#Test').is(":checked")) {
            $(".Test").css('display', 'block');
        }
        else {
            $(".Test").css('display', 'none');
        }

        // else if (type.toLowerCase() === "aarogyam") {
        //    var n = "aarogyam";
        //    searchData(n);
        //}
        //else {
        //    $(".Test").css('display', 'block');
        //    $(".Profile").css('display', 'block');
        //    $(".package").css('display', 'block');
        //}
    } else {
        $(".Test").css('display', 'block');
        $(".Profile").css('display', 'block');
        $(".package").css('display', 'block');
    }
}

function filterByCategory() {


    var type = $("input[name='CategoryDiv']:checked").val();
    if (type !== undefined) {


        var type1 = "", type2 = "", type3 = "", type4 = "", type5 = "";
        if ($('#cwellness').is(":checked")) {
            type1 = "CHILD WELLNESS";
        }

        if ($('#food').is(":checked")) {
            type2 = "FOOD INTOLERANCE";
        }
        if ($('#heart').is(":checked")) {
            type3 = "HEART HEALTH";
        }
        if ($('#thyroid').is(":checked")) {
            type4 = "THYROID";
        }
        if ($('#vitamin').is(":checked")) {
            type5 = "VITAMIN";
        }

        FilterSet(type1, type2, type3, type4, type5);
    }
    else {
        type = "";
        $("#ProductList > ul").filter(function () {
            $(this).toggle($(this).find(".Category").text().indexOf(type) > -1);
        });
        filterByType();
        filterByFasting();
    }

}

