$('#multi').slider({
    formatter: function (value) {
        FilterByPrice(0, value);
        return '0 - ' + value;
    }
});

function FilterByPrice(minPrice, maxPrice) {
    $("#ProductList > ul").hide().filter(function () {
        var price = parseInt($(this).find(".Rate").text(), 10);
        return price >= minPrice && price <= maxPrice;
    }).show();
}

function FilterByText() {
    var type = $("#SearchOnTest").val();
    if (type === "") {
        let params = (new URL(location)).searchParams;
        var searchQuery = params.get('searchQuery');
        if (searchQuery !== null) {
            if (searchQuery !== "") {
                window.location = window.location.pathname;
            }
        }

        $("#ProductList > ul").filter(function () {
            $(this).toggle($(this).find(".packageNames").text().toLowerCase().indexOf(type.toLowerCase()) > -1);
        });

        var TypeDiv = $("input[name=TypeDiv]:checkbox");
        var category = $("input[name=CategoryDiv]:checkbox");
        var Fasting = $("input[name=FastingDiv]:checkbox");

        if (TypeDiv.is(":checked")) {
            filterByType();
        }
        if (category.is(":checked")) {
            filterByCategory();
        }
        if (Fasting.is(":checked")) {
            filterByFasting();
        }
    }
    else {
        $("#ProductList > ul").filter(function () {
            $(this).toggle($(this).find(".packageNames").text().toLowerCase().indexOf(type.toLowerCase()) > -1);
        });
    }
}